import React from 'react';
import Navbar from "./Navbar";

const Error404 = () => {
    return(
        <div className="min-h-screen">
            <Navbar/>
            <div className="flex items-center justify-center py-10">
                <h1 className=''>
                     Pagina no encontrada 
                </h1>
                <p className=''>
                    Error404
                </p>
                <button className=''>
                    Home
                </button>
            </div>
        </div>
    );
};

export default Error404;
